--
-- Name: crearef(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION crearef() RETURNS character varying
    AS $$
DECLARE
    rs RECORD;
    result character varying(15);
    efound boolean;

BEGIN
    efound := FALSE;
    WHILE efound = FALSE LOOP
	result := random_string(6);
	efound := TRUE;
	SELECT INTO rs idpresupuesto FROM presupuesto WHERE refpresupuesto = result;
	IF FOUND THEN
	    efound := FALSE;
	END IF;
	SELECT INTO rs idpedidocliente FROM pedidocliente WHERE refpedidocliente = result;
	IF FOUND THEN
	    efound := FALSE;
	END IF;
	SELECT INTO rs idalbaran FROM albaran WHERE refalbaran = result;
	IF FOUND THEN
	    efound := FALSE;
	END IF;	
	SELECT INTO rs idfactura FROM factura WHERE reffactura = result;
	IF FOUND THEN
		efound := FALSE;
	END IF;
	SELECT INTO rs idcobro FROM cobro WHERE refcobro = result;
	IF FOUND THEN
		efound := FALSE;
	END IF;
	SELECT INTO rs idpedidoproveedor FROM pedidoproveedor WHERE refpedidoproveedor = result;
	IF FOUND THEN
		efound := FALSE;
	END IF;
	SELECT INTO rs idalbaranp FROM albaranp WHERE refalbaranp = result;
	IF FOUND THEN
		efound := FALSE;
	END IF;
	SELECT INTO rs idfacturap FROM facturap WHERE reffacturap = result;
	IF FOUND THEN
		efound := FALSE;
	END IF;
	SELECT INTO rs idpago FROM pago WHERE refpago = result;
	IF FOUND THEN
		efound := FALSE;
	END IF;
    END LOOP;
    RETURN result;
END;
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.crearef() OWNER TO postgres;

--
-- Name: crearutacomercial(date); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION crearutacomercial(date) RETURNS integer
    AS $_$
DECLARE
	fecha ALIAS FOR $1;
	client RECORD;
	nfechabase DATE;

BEGIN
	FOR client IN SELECT * FROM cliente LOOP
		nfechabase := client.fechabasecomercialcliente;
		RAISE NOTICE 'Nuevo Cliente';
		WHILE nfechabase <= fecha LOOP
			RAISE NOTICE ' Nuevo ciclo % %', nfechabase, fecha;
			IF fecha = nfechabase THEN
				-- Aqui toca crear la hoja de ruta.
				-- Al final actualizamos la fecha base para que los calculos sean siempre lo menos
				-- complejos y largos posible.
				RAISE NOTICE 'Hemos llegado al quiz';
				-- UPDATE cliente set fechabasecomercialcliente = nfechabase WHERE idcliente = client.idcliente;
			END IF;
			nfechabase := nfechabase + client.periodocomercialcliente;
--			RAISE NOTICE ' Calculo % %', nfechabase, fecha;
		END LOOP;
	END LOOP;
	RETURN 0;
END;
$_$
    LANGUAGE plpgsql;


ALTER FUNCTION public.crearutacomercial(date) OWNER TO postgres;

