CREATE FUNCTION disminuyestock() RETURNS "trigger"
    AS $$
DECLARE
BEGIN
    -- Hacemos el update del stock del articulo
    UPDATE articulo SET stockarticulo = stockarticulo + OLD.cantlalbaran WHERE idarticulo= OLD.idarticulo;
    RETURN NEW;
END;
$$
    LANGUAGE plpgsql;


