			NEW.numpresupuesto := 1;
		END IF;			
        END IF;
	IF NEW.refpresupuesto IS NULL OR NEW.refpresupuesto = '' THEN
		SELECT INTO rs crearef() AS m;
		IF FOUND THEN
			NEW.refpresupuesto := rs.m;
		END IF;
	END IF;
        RETURN NEW;
END;
$$
    LANGUAGE plpgsql;


